502,5,1,#:Event_If_RebornMonster 73 5 0:#:Event_EventState 103 6 0:Event_MonsterAction 73 822 102228 3 57 0:Event_TriggerEvent 503 3 0:Event_EventState 501 6 0:Event_EventState 502 6 0:,啊，我就知道被請來調查的一定是你。,
