504,5,1,#:Event_If_RebornMonster 73 5 0:#:Event_MonsterAction 73 821 102230 3 57 0:Event_TriggerEvent 505 3 0:,在進行平常的巡視任務時，我突然感應洞穴深處有一股奇怪的力量。,
