508,5,1,#:Event_If_RebornMonster 73 5 0:#:Event_MonsterAction 73 821 102234 3 57 0:Event_TriggerEvent 509 3 0:,傳言每一千年寒霜冰境內的地底深層就會結成一顆冰晶，這顆冰晶，具有能治癒任何疾病與傷口的能力。,
511,5,1,#:Event_If_RebornMonster 73 5 0:#:Event_MonsterAction 73 822 102236 5 57 0:,希望你能幫我進入深處調查，看看到底裡面發生了甚麼事情。,
